import React, { useState, useEffect } from 'react';



function Counter() {
  const [visitorCount, setVisitorCount] = useState(0);

  useEffect(() => {
    const count = localStorage.getItem('Visits');
    const initialCount = Number(count) || 0;
    setVisitorCount(initialCount + 1);
    localStorage.setItem('Visits', initialCount)
  }, []);
  return <div>Visitors {visitorCount}</div>;
}

export default Counter;
